using HelloUniverse.LinkedLists;
using NUnit.Framework;
using NUnit.Framework.Internal;
using System;
using System.Collections.Generic;

namespace HelloUniverse.Tests.LinkedLists
{
    [TestFixture]
    public class LinkedListSortTests
    {
        public delegate LinkedListSort.ListNode SortDelegate(LinkedListSort.ListNode head);

        [TestCaseSource(nameof(TestCases))]
        public void CornerCases(SortDelegate sort)
        {
            Assert.IsNull(sort(null));
            Assert.AreEqual("5", sort(new LinkedListSort.ListNode(5)).ToString());
        }

        [TestCaseSource(nameof(TestCases))]
        public void Size2Cases(SortDelegate sort)
        {
            var unSorted = new LinkedListSort.ListNode(5)
            {
                next = new LinkedListSort.ListNode(4)
            };

            Assert.AreEqual("4->5", sort(unSorted).ToString());
        }

        [TestCaseSource(nameof(TestCases))]
        public void OddNumberOfItems(SortDelegate sort)
        {
            var unSorted = new LinkedListSort.ListNode(7)
            {
                next = new LinkedListSort.ListNode(10)
                {
                    next = new LinkedListSort.ListNode(4)
                    {
                        next = new LinkedListSort.ListNode(9)
                        {
                            next = new LinkedListSort.ListNode(5)
                        }
                    }
                }
            };

            Assert.AreEqual("4->5->7->9->10", sort(unSorted).ToString());
        }


        [TestCaseSource(nameof(TestCases))]
        public void EvenNumberOfItems(SortDelegate sort)
        {
            var unSorted = new LinkedListSort.ListNode(7)
            {
                next = new LinkedListSort.ListNode(10)
                {
                    next = new LinkedListSort.ListNode(17)
                    {
                        next = new LinkedListSort.ListNode(9)
                        {
                            next = new LinkedListSort.ListNode(5)
                            {
                                next = new LinkedListSort.ListNode(4)
                            }
                        }
                    }
                }
            };

            Assert.AreEqual("4->5->7->9->10->17", sort(unSorted).ToString());
        }

        [TestCaseSource(nameof(TestCases))]
        public void EvenNumberOfItemsWithDuplicates(SortDelegate sort)
        {
            var unSorted = new LinkedListSort.ListNode(7)
            {
                next = new LinkedListSort.ListNode(10)
                {
                    next = new LinkedListSort.ListNode(7)
                    {
                        next = new LinkedListSort.ListNode(9)
                        {
                            next = new LinkedListSort.ListNode(5)
                            {
                                next = new LinkedListSort.ListNode(4)
                            }
                        }
                    }
                }
            };

            Assert.AreEqual("4->5->7->7->9->10", sort(unSorted).ToString());
        }

