        private LinkedListSort.ListNode ListNodeFromArray(int[] arr)
        {
            if (arr == null || arr.Length == 0)
            {
                return null;
            }

            var head = new LinkedListSort.ListNode(arr[0]);
            var temp = head;
            for (var i = 1; i < arr.Length; i++)
            {
                temp.next = new LinkedListSort.ListNode(arr[i]);
                temp = temp.next;
            }

            return head;
        }

